import React from "react";
import "./style.css";
interface IImageCardDada {
  link: string;
  firstHeader: string;
  secondHeader: string;
  imageUrl: string;
  className: string;
  headerStyle: React.CSSProperties;
  imageSize: React.CSSProperties;
  imageClass: string;
  firstHeaderStyle?: React.CSSProperties;
  secondHeaderStyle?: React.CSSProperties;
  firstHeaderClass?: string;
  secondHeaderClass?: string;
}

export const ImageCard = ({
  link,
  firstHeader,
  secondHeader,
  imageUrl,
  className,
  headerStyle,
  imageSize,
  imageClass,
  firstHeaderStyle,
  secondHeaderStyle,
}: IImageCardDada) => {
  return (
    <a href={link} className={`${className} image-card-main`}>
      <div className="position-align" style={headerStyle}>
        <span style={firstHeaderStyle} className="hover-text">
          {firstHeader}
        </span>
        <span style={secondHeaderStyle} className="hover-text">
          {secondHeader}
        </span>
      </div>

      <div style={imageSize} className={imageClass}>
        <img src={imageUrl} alt="card-image" className="card-image-size" />
      </div>
    </a>
  );
};
